import React, {Component} from 'react';

class SmallPlates extends Component {


    render(){
        return(
            <div id="smallPlates">
                <h3>Small Plates</h3>
                <div className="plateList">
                    <p>Small Plates</p>
                    <span>Everything tastes better on a small plate</span>


                </div>
            </div>

        )
    }
}


export default SmallPlates;
